import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'


class Header extends React.Component {
  constructor(props) {
    super(props)
    this.__handleClickAnimateHelpPanel = this.__handleClickAnimateHelpPanel.bind(this)
  }
  __handleClickAnimateHelpPanel() {
    const body = document.body;
    body.classList.add('showtime-help-screen');
  }
  __updateMembershipType() {
    const membership = this.props.membership
    const optionsArray = Array.prototype.slice.call(document.querySelectorAll(".js-hook-heading"));

    optionsArray.forEach(function(option) {
      if (membership != 'undefined' && option.classList != 'showtime' ) {
        option.classList.add('showtime')
      }
    })
  }
  componentDidUpdate() {
    this.__updateMembershipType()
  }
  render() {
    const { membership } = this.props

    return (
      <header className="header">
        <div className="header__wrapper">
          <div className="logo">
          <svg width="104px" height="36px" viewBox="0 0 104 36" version="1.1" >
              <defs></defs>
              <g id="Symbols" stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
                  <g id="header/corporation-c" transform="translate(-64.000000, -26.000000)">
                      <g id="header--c-corporation">
                          <image id="logo" x="64" y="26" width="104" height="36.4" xlinkHref="data:image/png;base64,"></image>
                      </g>
                  </g>
              </g>
          </svg>

          </div>
          <div className="heading">
            <div className="heading__title js-hook-heading">Membership Application</div>
            <div className="heading__sub js-hook-heading">{membership}</div>
          </div>
          <div className="header__help">
            <div className="header__help__action" onClick={this.__handleClickAnimateHelpPanel}>Looking for help?</div>
          </div>
        </div>
      </header>
    )
  }
}

const mapStateToProps = ({ membership }) => ({ membership })

export default connect(mapStateToProps, null)(Header)
